{"16b.sol":{"content":"// SPDX-License-Identifier: MIT  
pragma solidity ^0.8.25;

import './SafeMath.sol';
contract SeizeBits{
mapping (address => uint) public balances;
mapping (address => mapping (address=>uint)) public allowance;
 uint public totalSupply = 100000000 * 10 ** 18;
 string public name = "Seize Bits";
 string public symbol = "16B";
 uint public decimals = 18;
 constructor(){
     balances[msg.sender] = totalSupply;
 }
 
 function balanceOf(address owner) public view returns (uint){
     return balances[owner];
 }
 
 event Transfer(address indexed from, address indexed to, uint value);
 event Approval(address indexed owner, address indexed spender, uint value);
 
 function transfer(address to, uint value) public returns(bool){
     require (balanceOf(msg.sender) >= value, 'balance too low');
  balances[to] = balances[to]+ value;
  balances[msg.sender] =  balances[msg.sender]-value;
  emit Transfer(msg.sender, to, value);
  return true;
 }
 function transferFrom(address from, address to, uint value) public returns(bool){  
     require(balanceOf(from)>=value, 'balance too low');
     require(allowance[from][msg.sender] >= value, 'allowance to low');
     balances[to] += value;
     balances[from] -= value;
     emit Transfer(from, to, value);
     return true;
 }
 function approve(address spender, uint value) public returns(bool){
     allowance[msg.sender][spender] = value;
     emit Approval(msg.sender, spender, value);
     return true;
 }
}"},"SafeMath.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;
library SafeMath {
    function add(uint256 a, uint256 b) internal pure returns (uint256) {
        uint256 c = a + b;
        require(c >= a, "SafeMath: addition overflow");
        return c;
    }
    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b <= a, "SafeMath: subtraction overflow");
        uint256 c = a - b;
        return c;
    }
    function mul(uint256 a, uint256 b) internal pure returns (uint256) {
        if (a == 0) {
            return 0;
        }
        uint256 c = a * b;
        require(c / a == b, "SafeMath: multiplication overflow");
        return c;
    }
    function div(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b > 0, "SafeMath: division by zero");
        uint256 c = a / b;
        return c;
    }
}
